/** @format */

import React from "react";
import AppLayout from "../components/AppLayout";
import { useSelector } from "react-redux";
import styled from "styled-components";

const MyProfileBlock = styled.div`
  position: fixed;
  top: 0;
  width: 100%;
  height: 15%;
  padding-left: 15px;
`;
const Profile = () => {
  return (
    <AppLayout>
      <MyProfileBlock>
        <h2>이름</h2>
        <p>전화번호</p>
      </MyProfileBlock>
    </AppLayout>
  );
};

export default Profile;
